高精度と省電力を両立した最新鋭のレーザーセンサーを搭載<br>一気に数千行をスクロールできる高速スクロールと左右スクロールができる5ボタンワイヤレスレーザーマウス。<br><br>■高精度＆省電力を実現したレーザーセンサーマウス<br>省電力と高精度を両立した最新鋭のレーザーセンサーの5ボタンマウス。<br>数千行を一気にスクロールできる高速スクロールと左右スクロールが可能なチルトホイールを搭載しています。<br><br>■省電力＆高精度/レーザーセンサー<br>高精度と省電力を両立した最新鋭のレーザーセンサーを搭載した、微細な動きも確実にカーソルに伝えるレーザーマウスです。<br><br>■エルゴノミクスデザイン<br>ディープなグリップ感で、精密な読み取り性能をアシストするエルゴノミクスデザインを採用しています。<br><br>■5ボタンマウス<br>Webページ閲覧の効率を上げる「進む」、「戻る」ボタンを搭載した5ボタンタイプです。<br><br>■OMRON社製スイッチを採用<br>左右のボタンには耐久性において信頼性が高く、クリック感にも定評のあるOMRON社製スイッチを採用しています。<br><br>■高速スクロール機能を搭載<br>一気に数千行をスクロールできる、高速スクロール機能を搭載しています。<br><br>■スクロールモードを手元ボタンで切替可能<br>ホイールの引っかかりがなく、高速スクロールモードと、1行ずつ正確に回転できる通常スクロールモードを手元のボタンで簡単に切替可能です。<br><br>■チルトホイール搭載<br>ホイールを傾けるだけで左右にスクロールできるチルトホイールを搭載しています。<br>※ドライバのインストールが必要です。ドライバはメーカーWebサイトからダウンロード可能です。<br><br>■ポインタ速度変更ボタン<br>本体上部にポインタ速度変更ボタンを装備し、用途にあわせてマウスのカーソル速度を1000/2000カウントの2段階に切り替え可能です。<br><br>■無線方式は2.4GHz帯を採用<br>無線方式は2.4GHz帯を採用し、非磁性体で約10m、スチールデスクなど磁性体上でも約3mの範囲で使用可能です。(メーカー調べ)<br><br>■1円玉サイズのマイクロレシーバ<br>ノートパソコンのUSBポートに接続しても気にならず、装着したまま持ち運び可能な1円玉サイズのマイクロレシーバを採用しています。<br><br>■ボタン機能の割り当て変更ができる<br>ボタンの機能割り当ては、無料でダウンロードできる「エレコム/マウスアシスタント」を利用して変更可能です。<br>※WindowsRTには対応していません。<br><br>■ラージサイズ<br>手になじみやすく、動かしやすいラージサイズです。<br><br>■マウス内にレシーバを収納可<br>レシーバはマウス本体内に収納可能なので、持ち運びに便利で、レシーバを紛失する心配を軽減します。<br><br>■電源スイッチ付き<br>本体裏面に電源スイッチがあり、不使用時の電池の消耗を防止できます。<br><br>■電池残量表示ランプ<br>電池の交換時期をお知らせする電池残量表示ランプを搭載しています。<br><br>※ご使用いただくうちに、汗や油によってマウスのラバー部分に白い粉のようなものが現れることがございます。<br>こまめにお手入れをしてお使いください。<br><br><br>■■仕様■■<br>インターフェイス/USB<br>コネクタ形状/USB(A)オス<br>対応機種/USBインターフェイスを装備したWindowsパソコン、Macintosh、<br>対応OS/Windows10,WindowsRT8.1、Windows8.1、Windows7、WindowsVista、Mac/OS/X/10.11<br>分解能/1000/2000カウント(切り替え可能)<br>通信方式/GFSK方式<br>電波周波数/2.4GHz帯<br>電波到達距離/磁性体(鉄の机など)の上で使用する場合:3m、非磁性体(木の机など)の上で使用する場合:10m<br>読取り方式/レーザー方式<br>レーザー規格/JIS/C6802及び国際標準化機関IEC60825-1に基づいたCLASS1に準拠<br>射出光線種類/不可視波長域<br>ボタン数/5個/※ホイールボタン含む<br>ホイール数/1個<br>横スクロール機能/○<br>レシーバ収納/○<br>連続動作時間/約195時間<br>連続待機時間/約750日<br>想定電池使用期間/約405日<br>電源(本体)/単4形アルカリ乾電池、単4形マンガン乾電池、単4形ニッケル水素電池のいずれか2本<br>定格電圧(本体)/1.5V<br>カラー/ブラック<br>外形寸法(マウス本体)/幅63.2mm×奥行111.0mm×高さ40.6mm<br>サイズ分類/Lサイズ<br>質量(マウス本体)/約80g/※電池含まず<br>外形寸法(レシーバ)/幅15.0mm×奥行18.0mm×高さ6.0mm<br>質量(レシーバ)/約2g<br>付属品/動作確認用単4形アルカリ乾電池×2、ユーザーズマニュアル×1<br>保証期間/6カ月<br><br>※仕様は予告なく変更する事がありますので、あらかじめご了承ください。<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：エレコム<br>シリーズ名：M-LS16DL<br>カラー：ブラック<br>外形寸法(マウス本体)：幅63.2mm×奥行111.0mm×高さ40.6mm<br>サイズ分類：Lサイズ<br>質量(マウス本体)：約80g：※電池含まず<br>外形寸法(レシーバ)：幅15.0mm×奥行18.0mm×高さ6.0mm<br>質量(レシーバ)：約2g<br><br>購入単位：1個<br>配送種別：在庫品</p></td></tr></table><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>エレコム レーザーマウス 高速スクロール 無線 5ボタン ブラック M-LS16DLBK えれこむ まうす こうそくすくろーる コウソクスクロール 無線 むせん ムセン 5ぼたん ぶらっく</font></td></tr></table><style type="text/css">
